    E_h = URIRef("http://qudt.org/vocab/unit/E_h")  # <p>The \(\textit{Hartree}\) (symbol: \(E_h\) or \(Ha\)), also known as the \(\text{Hartree\,Energy}\), is the atomic unit of energy. The hartree energy is equal to the absolute value of the electric potential energy of the hydrogen atom in its ground state. The energy of the electron in an H-atom in its ground state is \(-E_H\), where \(E_H= 2 R_\infty \cdot hc_0\). The 2006 CODATA recommended value was \(E_H = 4.35974394(22) \times 10^{-18} J = 27.21138386(68) eV\).</p> <dt class="size-14">Definition:</dt> <dd>\(E_H= \frac{e^2}{4\pi \epsilon_0 a_0 }\)<br/> where, \(e\) is the elementary charge, \(\epsilon_0\) is the electric constant, and \(a_0\) is the Bohr radius.'</dd>
