    H = URIRef("http://qudt.org/vocab/unit/H")  # The SI unit of electric inductance. A changing magnetic field induces an electric current in a loop of wire (or in a coil of many loops) located in the field. Although the induced voltage depends only on the rate at which the magnetic flux changes, measured in webers per second, the amount of the current depends also on the physical properties of the coil. A coil with an inductance of one henry requires a flux of one weber for each ampere of induced current. If, on the other hand, it is the current which changes, then the induced field will generate a potential difference within the coil: if the inductance is one henry a current change of one ampere per second generates a potential difference of one volt. The henry is a large unit; inductances in practical circuits are measured in millihenrys (mH) or microhenrys (u03bc H). The unit is named for the American physicist Joseph Henry (1797-1878), one of several scientists who discovered independently how magnetic fields can be used to generate alternating currents. \(\text{H} \; \equiv \; \text{henry}\; \equiv\; \frac{\text{Wb}}{\text{A}}\; \equiv\; \frac{\text{weber}}{\text{amp}}\; \equiv\ \frac{\text{V}\cdot\text{s}}{\text{A}}\; \equiv\; \frac{\text{volt} \cdot \text{second}}{\text{amp}}\; \equiv\ \Omega\cdot\text{s}\; \equiv\; \text{ohm.second}\)
