    J_PER_M3 = URIRef("http://qudt.org/vocab/unit/J-PER-M3")  # \(\textit{Joule Per Cubic Meter}\) (\(J/m^{3}\)) is a unit in the category of Energy density. It is also known as joules per cubic meter, joule per cubic metre, joules per cubic metre, joule/cubic meter, joule/cubic metre. This unit is commonly used in the SI unit system.  It has a dimension of \(ML^{-1}T^{-2}\) where \(M\) is mass, \(L\) is length, and \(T\) is time. This unit is the standard SI unit in this category.
