    J_PER_MOL = URIRef("http://qudt.org/vocab/unit/J-PER-MOL")  # The joule per mole (symbol: \(J\cdot mol^{-1}\)) is an SI derived unit of energy per amount of material. Energy is measured in joules, and the amount of material is measured in moles. Physical quantities measured in \(J\cdot mol^{-1}\)) usually describe quantities of energy transferred during phase transformations or chemical reactions. Division by the number of moles facilitates comparison between processes involving different quantities of material and between similar processes involving different types of materials. The meaning of such a quantity is always context-dependent and, particularly for chemical reactions, is dependent on the (possibly arbitrary) definition of a 'mole' for a particular process.
    J_PER_MOL_K = URIRef("http://qudt.org/vocab/unit/J-PER-MOL-K")  # Energy needed to heat one mole of substance by 1 Kelvin, under standard conditions (not standard temperature and pressure STP). The standard molar entropy is usually given the symbol S, and has units of joules per mole kelvin ( \( J\cdot mol^{-1} K^{-1}\)). Unlike standard enthalpies of formation, the value of S is an absolute. That is, an element in its standard state has a nonzero value of S at room temperature.
