    PlanckCharge = URIRef("http://qudt.org/vocab/unit/PlanckCharge")  # In physics, the Planck charge, denoted by, is one of the base units in the system of natural units called Planck units. It is a quantity of electric charge defined in terms of fundamental physical constants. The Planck charge is defined as: coulombs, where: is the speed of light in the vacuum, is Planck's constant, is the reduced Planck constant, is the permittivity of free space is the elementary charge = (137.03599911) is the fine structure constant. The Planck charge is times greater than the elementary charge \(e\) carried by an electron.
    PlanckCurrent = URIRef("http://qudt.org/vocab/unit/PlanckCurrent")  # The Planck current is the unit of electric current, denoted by IP, in the system of natural units known as Planck units. \(\approx 3.479 \times 10 A\), where:  the Planck time is the permittivity in vacuum and the reduced Planck constant G is the gravitational constant c is the speed of light in vacuum. The Planck current is that current which, in a conductor, carries a Planck charge in Planck time. Alternatively, the Planck current is that constant current which, if maintained in two straight parallel conductors of infinite length and negligible circular cross-section, and placed a Planck length apart in vacuum, would produce between these conductors a force equal to a Planck force per Planck length.
    PlanckCurrentDensity = URIRef("http://qudt.org/vocab/unit/PlanckCurrentDensity")  # 
    PlanckDensity = URIRef("http://qudt.org/vocab/unit/PlanckDensity")  # The Planck density is the unit of density, denoted by \(\rho_P\), in the system of natural units known as Planck units. \(1\  \rho_P \ is \approx 5.155 \times 10^{96} kg/m^3\). This is a unit which is very large, about equivalent to \(10^{23}\) solar masses squeezed into the space of a single atomic nucleus. At one unit of Planck time after the Big Bang, the mass density of the universe is thought to have been approximately one unit of Planck density.
    PlanckEnergy = URIRef("http://qudt.org/vocab/unit/PlanckEnergy")  # In physics, the unit of energy in the system of natural units known as Planck units is called the Planck energy, denoted by \(E_P\). \(E_P\) is a derived, as opposed to basic, Planck unit. An equivalent definition is:\(E_P = \hbar / T_P\) where \(T_P\) is the Planck time. Also: \(E_P = m_P c^2\) where \(m_P\) is the Planck mass.
    PlanckForce = URIRef("http://qudt.org/vocab/unit/PlanckForce")  # Planck force is the derived unit of force resulting from the definition of the base Planck units for time, length, and mass. It is equal to the natural unit of momentum divided by the natural unit of time.
    PlanckFrequency = URIRef("http://qudt.org/vocab/unit/PlanckFrequency")  # 
    PlanckFrequency_Ang = URIRef("http://qudt.org/vocab/unit/PlanckFrequency_Ang")  # 
    PlanckImpedance = URIRef("http://qudt.org/vocab/unit/PlanckImpedance")  # The Planck impedance is the unit of electrical resistance, denoted by ZP, in the system of natural units known as Planck units. The Planck impedance is directly coupled to the impedance of free space, Z0, and differs in value from Z0 only by a factor of \(4\pi\). If the Planck charge were instead defined to normalize the permittivity of free space, \(\epsilon_0\), rather than the Coulomb constant, \(1/(4\pi\epsilon_0)\), then the Planck impedance would be identical to the characteristic impedance of free space.
    PlanckLength = URIRef("http://qudt.org/vocab/unit/PlanckLength")  # In physics, the Planck length, denoted \(\ell_P\), is a unit of length, equal to \(1.616199(97)Ã—10^{-35}\)Â metres. It is a base unit in the system of Planck units. The Planck length can be defined from three fundamental physical constants: the speed of light in a vacuum, Planck's constant, and the gravitational constant. 
    PlanckMass = URIRef("http://qudt.org/vocab/unit/PlanckMass")  # In physics, the Planck mass, denoted by \(m_P\), is the unit of mass in the system of natural units known as Planck units. It is defined so that \(\approx  1.2209 \times 10 GeV/c_0 = 2.17651(13) \times 10 kg\), (or \(21.7651 \mu g\)), where \(c_0\) is the speed of light in a vacuum, \(G\) is the gravitational constant, and \(\hbar\) is the reduced Planck constant. Particle physicists and cosmologists often use the reduced Planck mass, which is \(\approx  4.341 \times 10 kg = 2.435  \times 10 GeV/c\). The added factor of \(1/{\sqrt{8\pi}}\) simplifies a number of equations in general relativity. Quantum effects are typified by the magnitude of Planck's constant.
    PlanckMomentum = URIRef("http://qudt.org/vocab/unit/PlanckMomentum")  # Planck momentum is the unit of momentum in the system of natural units known as Planck units. It has no commonly used symbol of its own, but can be denoted by, where is the Planck mass and is the speed of light in a vacuum. Then where is the reduced Planck's constant, is the Planck length, is the gravitational constant. In SI units Planck momentum is \(\approx 6.5 kg m/s\).
    PlanckPower = URIRef("http://qudt.org/vocab/unit/PlanckPower")  # The Planck energy divided by the Planck time is the Planck power \(P_p \), equal to about \(3.62831 \times 10^{52} W\). This is an extremely large unit; even gamma-ray bursts, the most luminous phenomena known, have output on the order of \(1 \times 10^{45} W\), less than one ten-millionth of the Planck power.
    PlanckPressure = URIRef("http://qudt.org/vocab/unit/PlanckPressure")  # 
    PlanckTemperature = URIRef("http://qudt.org/vocab/unit/PlanckTemperature")  # 
    PlanckTime = URIRef("http://qudt.org/vocab/unit/PlanckTime")  # In physics, the Planck time, denoted by \(t_P\), is the unit of time in the system of natural units known as Planck units. It is the time required for light to travel, in a vacuum, a distance of 1 Planck length. The unit is named after Max Planck, who was the first to propose it. \( \\ t_P \equiv  \sqrt{\frac{\hbar G}{c^5}} \approx 5.39106(32) \times 10^{-44} s\) where, \(c\) is the speed of light in a vacuum, \(\hbar\) is the reduced Planck's constant (defined as \(\hbar = \frac{h}{2 \pi}\) and \(G\) is the gravitational constant. The two digits between parentheses denote the standard error of the estimated value.
    PlanckVolt = URIRef("http://qudt.org/vocab/unit/PlanckVolt")  # 
