    QUAD = URIRef("http://qudt.org/vocab/unit/QUAD")  # A quad is a unit of energy equal to \(10 BTU\), or \(1.055 \times \SI{10}{\joule}\), which is \(1.055 exajoule\) or \(EJ\) in SI units. The unit is used by the U.S. Department of Energy in discussing world and national energy budgets. Some common types of an energy carrier approximately equal 1 quad are: 8,007,000,000 Gallons (US) of gasoline 293,083,000,000 Kilowatt-hours (kWh) 36,000,000 Tonnes of coal 970,434,000,000 Cubic feet of natural gas 5,996,000,000 UK gallons of diesel oil 25,200,000 Tonnes of oil 252,000,000 tonnes of TNT or five times the energy of the Tsar Bomba nuclear test.
