    RAD_PER_MIN = URIRef("http://qudt.org/vocab/unit/RAD-PER-MIN")  # Radian Per Minute (rad/min) is a unit in the category of Angular velocity. It is also known as radians per minute, radian/minute. Radian Per Minute (rad/min) has a dimension of aT-1 where T is time. It can be converted to the corresponding standard SI unit rad/s by multiplying its value by a factor of 0.0166666666667. 
    RAD_PER_SEC = URIRef("http://qudt.org/vocab/unit/RAD-PER-SEC")  # "Radian per Second" is the SI unit of rotational speed (angular velocity), and, also the unit of angular frequency. The radian per second is defined as the change in the orientation of an object, in radians, every second.
    RAD_PER_SEC2 = URIRef("http://qudt.org/vocab/unit/RAD-PER-SEC2")  # Angular acceleration is the rate of change of angular velocity. In SI units, it is measured in radians per Square second (\(rad/s^2\)), and is usually denoted by the Greek letter \(\alpha\).
    RAD_R = URIRef("http://qudt.org/vocab/unit/RAD_R")  # The \(rad\) is a deprecated unit of absorbed radiation dose, defined as \(1 rad = 0.01\,Gy = 0.01 J/kg\). It was originally defined in CGS units in 1953 as the dose causing 100 ergs of energy to be absorbed by one gram of matter. It has been replaced by the gray in most of the world. A related unit, the \(roentgen\), was formerly used to quantify the number of rad deposited into a target when it was exposed to radiation. The F-factor can used to convert between rad and roentgens. The material absorbing the radiation can be human tissue or silicon microchips or any other medium (for example, air, water, lead shielding, etc.).
    RAYL = URIRef("http://qudt.org/vocab/unit/RAYL")  # dcterms:description "\(\textbf{Rayl}\) is one of two units of specific acoustic impedance. When sound waves pass through any physical substance the pressure of the waves causes the particles of the substance to move. The sound specific impedance is the ratio between the sound pressure and the particle velocity it produces. The specific impedance is one rayl if unit pressure produces unit velocity. It is defined as follows: \(1\; rayl = 1 dyn\cdot s\cdot cm^{-3}\) Or in SI as: \(1 \; rayl = 10^{-1}Pa\cdot s\cdot m^{-1}\), which equals \(10\,N \cdot s\cdot m^{-3}\)."""^^qudt:LatexString ;
    REM = URIRef("http://qudt.org/vocab/unit/REM")  # A Rem is a deprecated unit used to measure the biological effects of ionizing radiation. The rem is defined as equal to 0.01 sievert, which is the more commonly used unit outside of the United States. Equivalent dose, effective dose, and committed dose can all be measured in units of rem. These quantities are products of the absorbed dose in rads and weighting factors. These factors must be selected for each exposure situation; there is no universally applicable conversion constant from rad to rem. A rem is a large dose of radiation, so the millirem (mrem), which is one thousandth of a rem, is often used for the dosages commonly encountered, such as the amount of radiation received from medical x-rays and background sources.
    REV = URIRef("http://qudt.org/vocab/unit/REV")  # "Revolution" is a unit for  'Plane Angle' expressed as \(rev\).
    REV_PER_HR = URIRef("http://qudt.org/vocab/unit/REV-PER-HR")  # "Revolution per Hour" is a unit for  'Angular Velocity' expressed as \(rev/h\).
