    REV_PER_SEC2 = URIRef("http://qudt.org/vocab/unit/REV-PER-SEC2")  # "Revolution per Square Second" is a C.G.S System unit for  'Angular Acceleration' expressed as \(rev-per-s^2\).
    ROD = URIRef("http://qudt.org/vocab/unit/ROD")  # A unit of distance equal to 5.5 yards (16 feet 6 inches).
