    RwandaFranc = URIRef("http://qudt.org/vocab/unit/RwandaFranc")  # Rwanda
    S = URIRef("http://qudt.org/vocab/unit/S")  # \(\textbf{Siemens}\) is the SI unit of electric conductance, susceptance, and admittance. The most important property of a conductor is the amount of current it will carry when a voltage is applied. Current flow is opposed by resistance in all circuits, and by also by reactance and impedance in alternating current circuits. Conductance, susceptance, and admittance are the inverses of resistance, reactance, and impedance, respectively. To measure these properties, the siemens is the reciprocal of the ohm. In other words, the conductance, susceptance, or admittance, in siemens, is simply 1 divided by the resistance, reactance or impedance, respectively, in ohms. The unit is named for the German electrical engineer Werner von Siemens (1816-1892). \(\  \text{Siemens}\equiv\frac{\text{A}}{\text{V}}\equiv\frac{\text{amp}}{\text{volt}}\equiv\frac{\text{F}}{\text {s}}\equiv\frac{\text{farad}}{\text{second}}\)
    S_M2_PER_MOL = URIRef("http://qudt.org/vocab/unit/S-M2-PER-MOL")  # 
    S_PER_CentiM = URIRef("http://qudt.org/vocab/unit/S-PER-CentiM")  # 
